import * as appStyles from './App.css'
import * as classnames from 'classnames/bind';
import { Resizable } from 'react-resizable';
const cx = classnames.bind({...commonStyles, ...appStyles});


function App() {
  const [height, setHeight] = React.useState(200)
  const [width, setWidth] = React.useState(200)
  const onResize = (event, {element, size, handle}) => {
    setHeight(size.height)
    setWidth(size.width)
  };
  return (
    <>
      <div className={cx('top-bar-div')}>
        <div>setting</div>
        <div>PlayerInfo</div>
        <div>View Select</div>
        <div>QuickLinks</div>
      </div>

      <div className={cx('main-container')}>
      <Resizable height={height} width={width} onResize={(e)=>onResize(e)}>
        <div className="box" style={{width: width + 'px', height: height + 'px'}}>
          <span>Contents</span>
        </div>
      </Resizable>
        {/* <ResizePanel direction="e"  > */}
